description:
Verenigd Koninkrijk / Frankrijk
Familie / Komedie
109 minuten

leuk

met Emma Thompson, Ralph Fiennes en Maggie Gyllenhaal

Nanny McPhee (Thompson) arriveert om een jonge moeder te helpen (Gyllenhaal) die probeert haar familieboerderij te runnen, 
terwijl haar echtgenoot van huis is. De magische kinderjuf gebruikt haar krachten om de kinderen van de moeder en hun twee 
verwende neven vijf nieuwe lessen te leren.
